import React from 'react';
import { View, Text, Button, Image, StyleSheet } from 'react-native';

const Students = ({ navigation }) => {
  const handleDenuncia = () => {
    // Lógica para la opción "Denunciar"
    // Puedes navegar a una nueva pantalla o mostrar un modal aquí
    alert('Denunciar');
  };

  const handleReporte = () => {
    // Lógica para la opción "Reporte"
    // Puedes navegar a una nueva pantalla o mostrar un modal aquí
    alert('Reporte');
  };

  return (
    <View style={styles.container}>
      <Image
        source={require('../images/municipioqueretaro.png')}
        style={styles.image}
      />
      <Text style={styles.title}>Bienvenido a la página para estudiantes</Text>

      {/* Botones del menú */}
      <Button title="Denunciar" onPress={handleDenuncia} />
      <Button title="Reporte" onPress={handleReporte} />

      <Button
        title="Cerrar Sesión"
        onPress={() => alert('Implementa la lógica de cierre de sesión')}
      />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    paddingHorizontal: 20,
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 20,
  },
  image: {
    width: 200,
    height: 200,
    resizeMode: 'contain',
    marginBottom: 20,
  },
});

export default Students;
